import React from 'react'
import { StyleSheet, Text, View, Button } from 'react-native'
import {PricingCard} from 'react-native-elements';
import SupplierDetails from './SupplierDetails';

const PurchasePlan = ({ navigation }) => {
    return (
        <View style={styles.container} title = "SERE">
            <PricingCard
                color="#4f9deb"
                title="Basic"
                price="$999/month"
                info={[ 'Chatbot 24X7 Support', 'All Core Features']}
                onButtonPress = {()=>navigation.push('SupplierDetails')}
                button={{ title: 'Buy Now' }}
                />
            <PricingCard
                color="#068932"
                title="Advance"
                price="$499/month"
                info={['Equipment Health Dashboard', 'Chatbot 24X7 Support', 'All Core Features']}
                button={{ title: 'Buy Now' }}
                />
             <PricingCard
                color="#1f3d83"
                title="Premium"
                price="$999/month"
                info={['AR visualization', 'Show Featured Product', 'Chatbot 24X7 Support','All Core Features']}
                button={{ title: 'Buy Now' }}
                />
        </View>

    )
}

export default PurchasePlan

const styles = StyleSheet.create({
    container:{
        flex:1,
        flexDirection:'column',
        alignItems:'center',
        justifyContent:'center'
    },
    button:{
        margin:15,
        width:200,
        
    }
})
